import React from "react";
import "./Header.css";
import { NavLink } from "react-router-dom";

const Header = () => {
  return (
    <>
      <div className="navBar">
        <NavLink
          className="navImage"
          onClick={() => document.getElementById("profile").scrollIntoView()}
        >
          <i className="fa-solid fa-house"></i>
          <p>Profile</p>
        </NavLink>
        <NavLink
          className="navImage"
          onClick={() => document.getElementById("edu").scrollIntoView()}
        >
          <i className="fa-solid fa-graduation-cap"></i>
          <p>Education</p>
        </NavLink>
        <NavLink
          className="navImage"
          onClick={() =>
            document.getElementById("certifications").scrollIntoView()
          }
        >
          <i className="fa-solid fa-award"></i>
          <p>Activities & Achievements</p>
        </NavLink>
        <NavLink
          className="navImage"
          onClick={() => document.getElementById("projects").scrollIntoView()}
        >
          <i className="fa-solid fa-code"></i>
          <p>Projects</p>
        </NavLink>
        <NavLink
          className="navImage"
          onClick={() => document.getElementById("connect").scrollIntoView()}
        >
          <i className="fa-regular fa-handshake"></i>
          <p>Connect</p>
        </NavLink>
      </div>
    </>
  );
};

export default Header;
